        await poseInstance.setOptions({
          modelComplexity: 1,
          smoothLandmarks: true,
          enableSegmentation: false,
          smoothSegmentation: true,
          minDetectionConfidence: 0.5,
          minTrackingConfidence: 0.5
        });

        console.log('üéØ Setting onResults callback...');
        poseInstance.onResults(onResults);

        setPose(poseInstance);
        setIsReady(true);
        console.log('‚úÖ MediaPipe Pose loaded successfully!');

      } catch (error) {
        console.error('‚ùå Failed to load MediaPipe:', error);
        console.log('üîÑ Trying alternative loading method...');
        
        // ‡∏ó‡∏≤‡∏á‡πÄ‡∏•‡∏∑‡∏≠‡∏Å: ‡πÉ‡∏ä‡πâ script loading ‡πÅ‡∏ö‡∏ö‡∏õ‡∏•‡∏≠‡∏î‡∏†‡∏±‡∏¢‡∏Å‡∏ß‡πà‡∏≤
        try {
          await loadMediaPipeScripts();
        } catch (scriptError) {
          console.error('‚ùå Script loading also failed:', scriptError);
        }
      }
    };

    const loadMediaPipeScripts = async () => {
      // ‡πÇ‡∏´‡∏•‡∏î MediaPipe scripts ‡πÅ‡∏ö‡∏ö sequential ‡πÄ‡∏û‡∏∑‡πà‡∏≠‡∏´‡∏•‡∏µ‡∏Å‡πÄ‡∏•‡∏µ‡πà‡∏¢‡∏á‡∏õ‡∏±‡∏ç‡∏´‡∏≤
      const scripts = [
        'https://unpkg.com/@mediapipe/camera_utils/camera_utils.js',
        'https://unpkg.com/@mediapipe/control_utils/control_utils.js', 
        'https://unpkg.com/@mediapipe/drawing_utils/drawing_utils.js',
        'https://unpkg.com/@mediapipe/pose/pose.js'
