    const connections = [
      // ‡∏´‡∏ô‡πâ‡∏≤
      [0, 1], [1, 2], [2, 3], [3, 4],
      // ‡∏•‡∏≥‡∏ï‡∏±‡∏ß
      [5, 6], [5, 11], [6, 12], [11, 12],
      // ‡πÅ‡∏Ç‡∏ô‡∏ã‡πâ‡∏≤‡∏¢
      [5, 7], [7, 9],
      // ‡πÅ‡∏Ç‡∏ô‡∏Ç‡∏ß‡∏≤  
      [6, 8], [8, 10],
      // ‡∏Ç‡∏≤‡∏ã‡πâ‡∏≤‡∏¢
      [11, 13], [13, 15],
      // ‡∏Ç‡∏≤‡∏Ç‡∏ß‡∏≤
      [12, 14], [14, 16]
    ];

    connections.forEach(([i, j]) => {
      const kp1 = pose.keypoints[i];
      const kp2 = pose.keypoints[j];
      
      if (kp1 && kp2 && kp1.score > 0.5 && kp2.score > 0.5) {
